import React, { useState } from 'react';


function App() {
    const [input, setInput] = useState({
        fName : "",
        lName : ""
    });
    const Inputval = (e) => {
        const value = e.target.value;
        const name = e.target.name;
        if(name === "fname"){
            setInput({fName : value});


        }else if(name === "lname"){
            setInput({lName : value});
        }
    };


    const Submit = (e) => {
        e.preventDefault();
        alert("form submited");
    };

    return(
        <>
            <div>
                <form onSubmit={Submit}>
                <h1>Hello</h1>
                    <input type="text" placeholder='Enter Your First Name' onChange={Inputval} name="fname" value={input.fName} />
                    <input type="text" placeholder='Enter Your Last Name' onChange={Inputval} name="lname" value={input.lName} />

                    <button type='submit'>Click Me</button>
                </form>
            </div>
        </>
    );
}

export default App;
